// SPDX-License-Identifier: GPL-3.0-only
pragma solidity ^0.8.0;

import "./ElvateSubscription.sol";
import "../node_modules/@pancakeswap/periphery/contracts/interfaces/IPancakeRouter02.sol";

/// @author aussedatlo
/// @title manager of pair/subscription trigger
contract ElvateCore is ElvateSubscription {
    address public routerContractAddress;
    // TODO: optimize size
    uint256 public precision = 10**15;
    uint256 public frequency = 60 * 6; // * 24;

    string public s = "";
    address public last;

    function test(string memory _test) external {
        s = _test;
        last = msg.sender;
    }

    event PairTriggered(
        uint256 indexed pairId,
        uint256 lastPaidAt,
        uint256 totalSubscriptions,
        uint256 totalAmountIn,
        uint256 totalAmountOut,
        uint256 fees
    );

    constructor(address _WBNBAddress, address _routerContractAddress)
        ElvateSubscription(_WBNBAddress)
    {
        routerContractAddress = _routerContractAddress;
    }

    /// @dev trigger all possible subscriptions of one pair
    /// @param _tokenIn address of tokenIn
    /// @param _tokenOut address of tokenOut
    function triggerSubscriptions(address _tokenIn, address _tokenOut)
        external
        onlyExistingPair(_tokenIn, _tokenOut)
    {
        uint256 pairId = pairByTokenInOut[_tokenIn][_tokenOut].id;
        uint256[] memory swapResult;
        address[] memory path = _getPath(_tokenIn, _tokenOut);
        Subscription[] memory eligibleSubscriptions = getEligibleSubscriptions(
            _tokenIn,
            _tokenOut
        );
        uint256 totalAmountIn = _getAmmount(eligibleSubscriptions);

        require(
            SafeMath.add(allPairs[pairId].lastPaidAt, frequency) <
                block.timestamp,
            "can't trigger now"
        );
        require(
            eligibleSubscriptions.length > 0,
            "no subscriptions eligible right now"
        );
        require(totalAmountIn > 0, "no token to buy");
        require(
            IERC20(_tokenIn).balanceOf(address(this)) >= totalAmountIn,
            "not enought tokenIn"
        );

        require(
            IERC20(_tokenIn).approve(routerContractAddress, totalAmountIn),
            "approve failed"
        );
        uint256 allowance = IERC20(_tokenIn).allowance(
            address(this),
            routerContractAddress
        );
        require(allowance >= totalAmountIn, "token allowance not sufficient");

        swapResult = IPancakeRouter02(routerContractAddress)
            .swapExactTokensForTokens(
                totalAmountIn,
                0, // TODO: deduct amountOutMin
                path,
                address(this),
                block.timestamp + 10000
            );

        // update lastPaidAt
        allPairs[pairId].lastPaidAt = block.timestamp;

        uint256 totalAmountOut = _deductFees(
            swapResult[swapResult.length - 1],
            _tokenOut
        );

        // distribute token to users
        _distributeSwap(
            _tokenIn,
            _tokenOut,
            eligibleSubscriptions,
            totalAmountIn,
            totalAmountOut
        );

        emit PairTriggered(
            pairId,
            allPairs[pairId].lastPaidAt,
            eligibleSubscriptions.length,
            totalAmountIn,
            swapResult[swapResult.length - 1],
            totalAmountOut
        );
    }

    /// @dev get all subscriptions available for one pair
    /// @param _eligibleSubscriptions list of all eligible subscriptions
    /// @return sum of all amountIn of all eligible subscription
    function _getAmmount(Subscription[] memory _eligibleSubscriptions)
        internal
        pure
        returns (uint256)
    {
        uint256 totalAmountIn = 0;

        for (uint256 index; index < _eligibleSubscriptions.length; index++) {
            totalAmountIn = SafeMath.add(
                _eligibleSubscriptions[index].amountIn,
                totalAmountIn
            );
        }

        return totalAmountIn;
    }

    /// @dev substract tokenIn based on subscription
    ///      and add tokenOut based on subscription weight
    /// @param _tokenIn address of tokenIn
    /// @param _tokenOut address of tokenOut
    /// @param _eligibleSubscriptions list of all eligible subscriptions
    /// @param _totalAmountIn sum of all amountIn of all eligible subscription
    /// @param _totalAmountOut amount of tokenOut obtained via swap
    function _distributeSwap(
        address _tokenIn,
        address _tokenOut,
        Subscription[] memory _eligibleSubscriptions,
        uint256 _totalAmountIn,
        uint256 _totalAmountOut
    ) internal {
        for (
            uint256 index = 0;
            index < _eligibleSubscriptions.length;
            index++
        ) {
            // substract tokenIn from user deposit based on subscription
            tokens[_tokenIn][_eligibleSubscriptions[index].owner] = SafeMath
                .sub(
                    tokens[_tokenIn][_eligibleSubscriptions[index].owner],
                    _eligibleSubscriptions[index].amountIn
                );

            // weight of subscription
            uint256 weight = SafeMath.div(
                // TODO: limits of mul with precision ?
                SafeMath.mul(_eligibleSubscriptions[index].amountIn, precision),
                _totalAmountIn,
                "error div"
            );

            // add amountOut to user based on weight of subscription
            uint256 amountOut = SafeMath.div(
                SafeMath.mul(_totalAmountOut, weight),
                precision
            );
            tokens[_tokenOut][_eligibleSubscriptions[index].owner] = SafeMath
                .add(
                    tokens[_tokenOut][_eligibleSubscriptions[index].owner],
                    amountOut
                );
        }
    }

    /// @dev get path of token pair
    /// @param _tokenIn address of tokenIn
    /// @param _tokenOut address of tokenOut
    function _getPath(address _tokenIn, address _tokenOut)
        public
        view
        returns (address[] memory)
    {
        if (_tokenIn != WBNBAddress && _tokenOut != WBNBAddress) {
            address[] memory pathWithWBNB = new address[](3);
            pathWithWBNB[0] = _tokenIn;
            pathWithWBNB[1] = WBNBAddress;
            pathWithWBNB[2] = _tokenOut;
            return pathWithWBNB;
        }

        address[] memory path = new address[](2);
        path[0] = _tokenIn;
        path[1] = _tokenOut;
        return path;
    }

    /// @dev get all subscriptions available for one pair
    /// @param _tokenIn address of tokenIn
    /// @param _tokenOut address of tokenOut
    function getEligibleSubscriptions(address _tokenIn, address _tokenOut)
        public
        view
        returns (Subscription[] memory)
    {
        uint256 count = 0;
        // temporary array memory of the size of all subscriptions
        Subscription[] memory eligibleSubsTemporary = new Subscription[](
            allSubscriptions.length
        );
        uint256 pairId = pairByTokenInOut[_tokenIn][_tokenOut].id;

        // add each eligible subscription to eligibleSubsTemporary
        // and count them
        for (uint256 index = 0; index < allSubscriptions.length; index++) {
            Subscription memory sub = allSubscriptions[index];
            if (
                sub.pairId == pairId &&
                tokens[_tokenIn][sub.owner] >= sub.amountIn
            ) {
                eligibleSubsTemporary[count] = allSubscriptions[index];
                count++;
            }
        }

        // create final array with the correct size
        // containing all eligible subscriptions
        Subscription[] memory eligibleSubs = new Subscription[](count);
        for (uint256 index = 0; index < count; index++) {
            eligibleSubs[index] = eligibleSubsTemporary[index];
        }

        return eligibleSubs;
    }
}

